import React from "react";
import "../NewExpens/ExpenseForm.css";

const ExpenseForm = () => {
  return (
    <div className="new-expense__controls">
      <label>
        Description:
        <input type="text"></input>
      </label>
      <label>
        Date:
        <input type="date"></input>
      </label>
      <label>
        Amount:
        <input type="number"></input>
      </label>
    </div>
  );
};

export default ExpenseForm;
